import React from "react";
import {ChangeFilterValue} from "../types/methods.type";
import {FilterType} from "../types/searchFilters.type";

export function FilterValue({filterType,filterValue, changeFilterValue}:{filterType:FilterType|null, filterValue:string, changeFilterValue:ChangeFilterValue}) {
    switch (filterType){
        case FilterType.name:
        case FilterType.owner:
            break;
        case FilterType.views:
            break;
        case FilterType.lastViewed:
            break;
        case FilterType.type:
            break;

    }
}
